import Cookies from 'universal-cookie'
import { Nav } from './Components';

import './App.css'
import { HomePage } from './Pages';

const App = (props) => {
  const [pageLocation, setPageLocation] = useState('home')

  return (
    <div id='home-container'>
      <div className='home-location'>
        <div className='home-location__title'>
          <span className='home-location__title1'>{`${pageLocation}`}</span>
          <span className='home-location__title2'>{' // samuelwright.dev'}</span>
        </div>
        <Nav pageLocation={pageLocation} setPageLocation={setPageLocation}/>
      </div>

      <Routes>
        <Route path="/" element={<HomePage />} />
      </Routes>


    </div>
  )
}

export default App;
